  POSTS: `${APP_NAME}/POSTS`,
  FEEDBACK: `${APP_NAME}/FEEDBACK`,
  ERRORS: `${APP_NAME}/ERRORS`,
  STATISTICS: `${APP_NAME}/STATISTICS`,
}

export const STORAGE = {
  TOKEN: `${APP_NAME}/TOKEN`,
}

export const FORMS = {
  SIGNIN: `${APP_NAME}/SIGNIN`,
